response.about:
Работаю честно. 
О дефектах предупреждаю сразу. 
Все чеки сохраняются. 
Если покупаете более 1 вещи - скидка. 
Бронь не более 3 дней (но если кто-то предлагает большую цену ваша бронь снимается.

Для пересылки Новой почтой необходимо указать: 
1.Ф.И.О.; 
2.Город; 
3. № отдиления; 
4.Моб.телефон; 

Для пересылки Укрпочтой необходимо указать:
1.Полный адрес;

Чтобы получить посылку вам нужно: 
1.Знать номер накладной (я вам сообщу номер после отправки товара); 
2.Иметь при себе паспорт; 

Стоимость доставки по полной предоплате 18грн (зависит от веса товара). Посылка прибывает на склад Новой Почты в городе, где проживает КЛИЕНТ. (Выбирается ближайшей состав к месту проживания Клиента). Клиент уведомляется СМС, когда посылка прибыла на склад. 
Срок доставки 1-2 дня. 
Товар возврату НЕ ПОДЛЕЖИТ, НО МОГУ ПОМОЧЬ ПРОДАТЬ. 

Пересылаю по всей Украине 
Пересылку оплачивает покупатель. 
Пересылаю только по полной оплате на катрочку Приват Банка. 
Не забывайте оставлять отзывы в альбоме
о купленном товаре
